import React from 'react'
import styles from '../styles/CreditCart.module.css'
import credits from '../../../assets/credits.svg'


export const CreditCart = (props) => {
  return(
    <>
        <div className={styles.containers}>

            <img src={credits} alt="" />

        </div>
    
    </>
   )
  }
